Hill's Prescription Diet Gastrointestinal Biome Корм для cобак c курицей - активно поддерживает регулярный нормальный стул и помогает снижать риск нарушения пищеварения в будущем. С передовой технологией ингредиентов ActivBiome+. Уникальная смесь пищевых волокон клинически доказано питает микробиом кишечника для поддержания здорового пищеварения и общего состояния здоровья.
