column31:
При неблагоприятных реакциях на пищу и ее компоненты.  
В качестве элиминационной диеты для исключения пищевой аллергии и неблагоприятной реакции на пищу и ее компоненты в случае: 
- Хронического зуда;
- Наружного отита;
- Желудочно-кишечных расстройств, таких как воспалительные заболевания кишечника (в том числе колит).

column39:
Kлинически доказано: способствует снижению проявления пищевой аллергии со стороны кожи и ЖКТ.

 Ключевые преимущества: 
 - Гипоаллергенная формула: содержит гидолизат белка животного происхождения и единственный источник углеводов;
 - Питание для видимого улучшения состояния кожи и шерсти через 30 дней;
 - Клинически доказано: помогает улучшить качество стула;
 - С превосходным вкусом, который понравится вашей собаке.

 Перед применением проконсультируйтесь с вашим ветеринарным специалистом.
